function I = fcnK3C(S, t, u, alpha, F, tol)
t1 = S .* alpha;t2 = -t1 + u;t3 = 0.1e1 ./ t2;t4 = sqrt(-alpha);t5 = F - t4;t6 = t5 .^ 2;t8 = t4 .* S;t9 = t5 .* t8;t12 = sqrt(t6 .* S - t1 + 0.2e1 .* t9 + u);t13 = 0.1e1 ./ t12;t16 = t3 .* t8;t20 = S .^ 2;t23 = 0.1e1 ./ (t2 .* S + alpha .* t20) ./ 0.4e1;t27 = sqrt(t2);t29 = 0.1e1 ./ t27 ./ t2;t32 = 0.1e1 ./ t5;t34 = log(0.2e1 .* t32 .* (t12 .* t27 - t1 + t9 + u));t37 = F + t4;t38 = t37 .^ 2;t40 = t37 .* t8;t43 = sqrt(t38 .* S - t1 - 0.2e1 .* t40 + u);t44 = 0.1e1 ./ t43;t54 = 0.1e1 ./ t37;t56 = log(0.2e1 .* t54 .* (t43 .* t27 - t1 - t40 + u));t59 = t3 .* t4;t63 = t2 .^ 2;t64 = 0.1e1 ./ t63;t70 = 0.1e1 ./ u;t77 = 0.1e1 ./ t27 ./ t63;t86 = -t4 .* alpha;t88 = 0.1e1 ./ alpha .* t86;t98 = t13 .* t70;t110 = t13 .* t3 ./ 0.2e1 - 0.2e1 .* t13 .* t23 .* (t5 .* S + t8) .* t16 - t34 .* t29 ./ 0.2e1 + t44 .* t3 ./ 0.2e1 + 0.2e1 .* t44 .* t23 .* (t37 .* S - t8) .* t16 - t56 .* t29 ./ 0.2e1 + t44 .* t54 .* t59 ./ 0.4e1 + 0.3e1 ./ 0.4e1 .* t44 .* t64 .* t1 + 0.3e1 ./ 0.4e1 .* F .* t44 .* t70 .* t64 .* alpha .* t20 .* t4 - 0.3e1 ./ 0.4e1 .* t56 .* t77 .* t1 + F .* S .* t44 .* t70 .* t59 ./ 0.2e1 + t13 .* t32 .* t3 .* t88 ./ 0.4e1 + 0.3e1 ./ 0.4e1 .* t13 .* t64 .* t1 + 0.3e1 ./ 0.4e1 .* F .* t98 .* t64 .* t20 .* t86 - 0.3e1 ./ 0.4e1 .* t34 .* t77 .* t1 + S .* F .* t98 .* t3 .* t88 ./ 0.2e1;
I = t110(:,:,2) - t110(:,:,1);

end
